import React from "react";
import "./App.css";
import { Product } from "./types";
import ProductList from "./pages/ProductList";

function App() {
  const product: Product[] = [
    { name: "Batman", description: "Description 1" },
    { name: "Marvelman", description: "Description 2" },
    { name: "Superman", description: "Description 3" },
  ];

  return (
    <>
      <ProductList productInfo={product} />
    </>
  );
}

export default App;
